const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <BrowserRouter>
        <ApolloProvider client={apolloClient}>
            <App />
        </ApolloProvider>
    </BrowserRouter>,
);

export  {apolloClient}
